    ItextEditing = () => {
        let imgObject = this.state.canvases[0].getActiveObject();
        if(imgObject){
            if(imgObject.type==='i-text'){
                document.getElementById("Itext").style.display="block";
            }
            else{
                document.getElementById("Itext").style.display="none";
            }
            $("#image-editing-tools").css("display","block");
        }
        else{
            //document.getElementById("Itext").style.display="none";
            $("#image-editing-tools").css("display","none");
        }
    }
    grayScale = () => {
        let imgObject = this.state.canvases[0].getActiveObject();
        if(imgObject){
            let filter = new fabric.Image.filters.Grayscale();
            imgObject.filters.push(filter);
            imgObject.applyFilters();
            this.state.canvases[0].renderAll();
        }
        else{
            alert("No image Selected!");
        }
    }
    sepia = () => {
        let imgObject = this.state.canvases[0].getActiveObject();
        if(imgObject){
            let filter = new fabric.Image.filters.Sepia();
            imgObject.filters.push(filter);
            imgObject.applyFilters();
            this.state.canvases[0].renderAll();
        }
        else{
            alert("No image Selected!");
        }
    }
    metal = () => {
        let imgObject = this.state.canvases[0].getActiveObject();
        if(imgObject){
            let filter = new fabric.Image.filters.Contrast({
                contrast: -0.1
            });
            imgObject.filters.push(filter);
            imgObject.applyFilters();
            this.state.canvases[0].renderAll();
        }
        else{
            alert("No image Selected!");
        }
    }
    original = () => {
        let imgObject = this.state.canvases[0].getActiveObject();
        if(imgObject){
            imgObject.filters = [];
            imgObject.applyFilters();
            this.state.canvases[0].renderAll();
        }
        else{
            alert("No image Selected!");
        }
    }
	
    backgroundColor = (color) => {
        let imgObject = this.state.canvases[0];
        if(imgObject){
            imgObject.backgroundColor=color;
            imgObject.renderAll();
        }
        else{
            alert("Something Wrong!");
        }
    }
    group =()=>{
        let canvas=this.state.canvases[0];
        if (!canvas.getActiveObject()) {
            return;
          }
          if (canvas.getActiveObject().type !== 'activeSelection') {
            return;
          }
          canvas.getActiveObject().toGroup();
          canvas.requestRenderAll();
    }
    ungroup = () =>{
        let canvas=this.state.canvases[0];
        if (!canvas.getActiveObject()) {
            return;
          }
          if (canvas.getActiveObject().type !== 'group') {
            return;
          }
          canvas.getActiveObject().toActiveSelection();
          canvas.requestRenderAll();
    }
    
    save = () => {
        console.log(JSON.stringify(this.state.canvases[0].toJSON()));
    }
